import './App.css';
import Navbar from './components/Navbar';
import {BrowserRouter, Router, Route} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <Navbar/>
      <BrowserRouter>
      <Router>
        <Route path='/' element={<Create/>}/>
        <Route path='/all' element={<Read/>}/>
        <Route path='/update' element={<Update/>}/>
      </Router>
      </BrowserRouter>
    </div>
  );
}

export default App;
